#include <iostream>

auto solve(std::string words) -> std::string {
    std::string output;
    bool* occurence = new bool[256];
    for (auto i = 0; i < words.size(); i++) {
        char c = words.at(i);
        if (!occurence[c]) {
            output.push_back(c);
            occurence[c] = true;
        }
    }
    
    return output;
}

auto main() -> int {
    auto input = std::string{""};
    auto res = solve(input);
    std::cout << "result: " << res << std::endl;
    
    return 0;
}
